// define a function that checks if the digits in a number match their frequency
function f_gold(num) {
    // create an empty object to store the frequency of each digit
    var cnt = {};
    // loop through each digit in the number
    for (var i = 0; i < num.length; i++) {
        // if the digit is not in the object, add it with a frequency of 1
        if (cnt[num[i]] == undefined) {
            cnt[num[i]] = 1;
        } else {
            // if the digit is already in the object, increment its frequency
            cnt[num[i]] += 1;
        }
    }
    // loop through each digit in the number again
    for (var i = 0; i < num.length; i++) {
        // if the digit does not match its frequency in the object, return false
        if (parseInt(num[i]) != (cnt[i] || 0)) {
            return false;
        }
    }
    // if all digits match their frequency, return true
    return true;
}
